CREATE TABLE actormovie
(
    firstname text NOT NULL,
    lastname text NOT NULL,
    title text NOT NULL,
    year integer NOT NULL,
    CONSTRAINT actormovie_pkey PRIMARY KEY (firstname, lastname, title, year),
    CONSTRAINT firstname_lastname_fk FOREIGN KEY (firstname, lastname)
        REFERENCES actor (firstname, lastname),
    CONSTRAINT title_year_fk FOREIGN KEY (title, year)
        REFERENCES movie (title, year) 
);


